import Button from "react-bootstrap/Button";
import Modal from "react-bootstrap/Modal";

export const ModalError = () => {
  return (
    <div className="modal show" style={{ display: "block", position: "initial" }}>
      <Modal.Dialog>
        <Modal.Title>Эй, друг, по-моему ты делаешь что-то не так❗️</Modal.Title>

        <Modal.Body>
          <p>Введи более корректное имя покемона, а то успех будет явно не у тебя</p>
        </Modal.Body>

        <Modal.Footer>
          <Button variant="secondary">Close</Button>
        </Modal.Footer>
      </Modal.Dialog>
    </div>
  );
};
